import React from 'react';

const Dashboard = ({ supabase, session }) => {
  return (
    <div className='dashboard'>
      <p>Dashboard</p>
      <p>Welcome, {session.user.email}</p>
      <button onClick={() => supabase.auth.signOut()}>Sign Out</button>
    </div>
  );
};

export default Dashboard;
